const Contact = () => {
    return ( 
        <div className="Contact">
            <h2>Contacto</h2>
            <p>Web realizada por JuanJo Montero para la asignatura Sistemas Software Basados en Web dentro del Máster en Ingeniería Informática (M50.56.2) de la Universidad de Granada.</p>
            <img src={logo} className="App-logo" alt="logo" />
        </div> );
}
 
export default Contact;
